script: |
  super -f text -I q8337.spq | sort > q8337.out

inputs:
  - name: q8337.spq
    data: |
      SELECT + col1 AS col2 FROM tab1 (FORMAT parquet) WHERE NOT - col1 * + col1 * + col0 IN ( + tab1.col0 + + col0 * col1 );
  - name: tab1

outputs:
  - name: q8337.out
    data: |
      10
      13
      26
